(2, '1535829042', '2016-07-12', '1', '1', '', 'carrigaline', 'cork', 'ireland', 'new hospital', '', 0, 0, 0, '2016-08-22'),
(5, '1234', '2016-07-02', 'fake', 'street', '', 'cork', 'cork', 'ireland', 'new nursing home', 'Victory seemed unlikely. Mount Saint Michael were two sets down and St. Leo’s certainly had the upper hand in the third set, dominating 9 points to 2. Each time St. Leo’s scored, they pounded the ground in unison, further intimidating an already shaky Claremorris team. So how, in these circumstances, did they snatch victory from the jaws of almost certain defeat?\r\n\r\nThe first set seemed to suggest two teams who were equally matched. Michael’s fought point for point against a Leo’s team whose defence was almost impenetrable, yet Edel Nolan managed to hit home some impressive spikes. However, as the set drew to a close, they found themselves unable to finish the job and St Leo’s stormed into the second set with a 25-22 win in the first set under their belt.\r\n\r\nThis is where it all went wrong for Claremorris. Having lost the first set, their nerves took over and their difficulty settling into the match was evident in a plethora of unforced errors, despite excellent positioning by Nikki Hanley and impact substitutions by Lisa McGreal and Jackie Prendergast. They lost the second set 25-19 and hope began to fade for their 200+ supporters.\r\n\r\nThe third set began in similar fashion but sensing that they now had nothing to lose – except of course the All-Ireland Title – the team lifted their game tremendously, aided by the now deafening cries of their desperate supporters, led by Lisa Brett and Chloe Hughes. Strategic use of time outs by coach Fionnghuala King saw the girls finally settle into the match. She no doubt reminded them of their team mantra – no matter how badly things seem to be going ‘don’t lose your marbles’. Stephanie Mellet had a great run of serves and made a stunning save at this crucial point in the set. Aisling Croghan made some unbelievable hits from the wings and Edel Nolan shone as the driving force behind Mount St Michael’s incredible comeback. They won the third set 25-16 and St Leo’', 0, 0, 0, '2016-08-22'),
