(9, '12345', '2016-07-20', 'peamount hospital', 'newcastle', '', 'dublin 6', 'dublin', 'ireland', '120 bed new dev', 'Lomography is the commercial trademark of Lomographische AG, Austria for products and services catering to lo-fi photographers. The name is inspired by the former state-run optics manufacturer LOMO PLC of Saint Petersburg, Russia. LOMO PLC created and produced the 35mm LOMO LC-A Compact Automat camera — which became the centerpiece of Lomography’s marketing and sales activities. This camera was loosely based upon the Cosina CX-1 and introduced in the early 1980s. In 1991, the Austrian founders of Lomography discovered the Lomo LC-A. They were “charmed by the unique, colorful, and sometimes blurry” images that the camera produced. After a series of international art exhibitions and marketing, Lomography signed an exclusive distribution agreement with LOMO PLC — thereby becoming the sole distributor of all Lomo LC-A cameras outside of the Soviet Union. Since the introduction of the original Lomo LC-A, Lomography has produced and marketed various lines of branded analogue cameras. Most of these cameras are designed to produce a single photographic effect. In 2005, production of the original Lomo LC-A was discontinued. Its replacement, the LC-A+, was introduced in Fall 2006. The new camera, made in China rather than Russia, featured the original Russian lens manufactured by LOMO PLC. This changed as of mid-2007 with the lens now made in China as well. Similar to Eastman Kodak’s concept of the “Kodak moment”, the Lomography website endorses a motto of “Don’t Think, Just Shoot”. This motto is accompanied by the Ten Golden Rules of Lomography; guidelines encouraging spontaneity and minimal consideration of formal technique. The cameras marketed by Lomography are generally low-fidelity and inexpensively constructed. Some cameras make use of multiple lenses and colored flashes, or exhibit optical distortions and light leaks. Current models marketed by Lomographische AG include Lomo LC-A, Diana, Holga, Holga 35mm, Actionsampler, Frogeye, Pop-9, Oktomat, Fisheye, Fisheye2, Colorsplash, Colorsplash Flash, F-stop Bang, SuperSampler, Horizon 202, Seagull TLR, and Smena 8M. The company also resells dead stock Polaroid cameras and Russian dead stock. The Lomographic Society International owns galleries, stores and “showcases” dedicated to the growth, support and public exposure of the art. The society is based in Vienna, Austria, where most of its events are organised. An example of the society’s cultural events showcasing photographs from the community is the Lomokikuyu competition, which raises money for eye surgeries and vision care in Kenya, in partnership with Viennese vision aid organisation Light for the World. The project has since been updated and donations now also go to the International Committee of the Red Cross to help fight the famine in East Africa.', 0, 0, 0, '2016-08-01'),
